import React from "react";
import { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import bootstrap from "bootstrap/dist/css/bootstrap.min.css";
import bookingservice from "../services/bookingservice";
import AuthService from "../services/auth.service";
let p = localStorage.getItem("username");
let t = localStorage.getItem("train_name");

let tn = localStorage.getItem("train_no");
let fn = localStorage.getItem("fname");
let ln = localStorage.getItem("lname");
let age = localStorage.getItem("age");
let bookingId = localStorage.getItem("bookingId");
let start_from = localStorage.getItem("start_from");
let destination = localStorage.getItem("destination");
let coach_no = localStorage.getItem("coach_no");
let seat_no = localStorage.getItem("seat_no");
 let e = localStorage.getItem("email");

const Fullticket = () => {
  //  const booking = {
  //    train_no,
  //    train_name,
  //    fname,
  //    lname,
  //    age,
  //    start_from,
  //    destination,
  //    emailId,
  //    coach_no,
  //    seat_no,
  //    id,
  //  };
 
  // const [user, setFaculty] = useState([]);

 const [booking, setBooking] = useState([]);
//   const init = ({e}) => {
//     bookingservice.getbookingEmail(e)
//       .then((response) => {
//         console.log("Printing all booking ", response.data);
//         setBooking(response.data);
//       })
//       .catch((error) => {
//         console.log("Something went wrong", error);
//       });
//   };
//  useEffect(() => {
//    init();
//  }, []);
 useEffect(() => {
   if (e) {
     bookingservice
       .get(e)
       .then((bookings) => {
         
         setAge(bookings.data.age);
         setStartFrom(bookings.data.start_from);
         setDestination(bookings.data.destination);
         setEmailId(bookings.data.emailId);
         setSeatNo(bookings.data.seat_no);
         setCoachNo(bookings.data.coach_no);
       })
       .catch((error) => {
         console.log("Something went wrong", error);
       });
   }
 }, []);

  return (
    <div className="showcase">
      <div className="grid-container1">
        <div className="item2" style={{ marginLeft: "28rem", width: "35 rem" }}>
          {/* <p> Name:{p}</p>

        <p>Train Name:{t}</p>

        <p>First Name:{fn}</p>

        <p>Last Name:{ln}</p>

        <p>train No.:{tn}</p>

        <p>email:{e}</p>
        <p>age:{age}</p>

        <p>Start from :{start_from}</p>
        <p>destination:{destination}</p>
        <p>coach no:{coach_no}</p>
        <p>seat no:{seat_no}</p> */}
          <div className="tlist">
            {/* <p>email:{e}</p> */}
            <table className="table table-bordered table-dark table-striped">
              <thead className="thead-light">
                <tr>
                  <th> Train Name</th>
                  <th> Train No</th>
                  <th> FirstName</th>
                  <th> LastName</th>
                  <th> Age</th>
                  <th> Start from</th>
                  <th> Destination</th>
                  <th> emailId</th>
                  <th> seat no</th>
                  <th> coach no</th>

                  <th> Actions </th>
                </tr>
              </thead>
              <tbody>
                <tr key={e}>
                  <td>{booking.train_name}</td>
                  <td>{booking.train_no}</td>
                  <td>{booking.fname}</td>
                  <td>{booking.lname}</td>
                  <td>{booking.age}</td>
                  <td>{booking.start_from}</td>
                  <td>{booking.destination}</td>
                  <td>{booking.emailId}</td>
                  <td>{booking.seat_no}</td>
                  <td>{booking.coach_no}</td>
                  <td>
                    Delete
                    <Link
                      className="btn btn-warning"
                      to={`/booking/edit/${booking.id}`}
                    >
                      Update
                    </Link>
                  </td>
                </tr>
              </tbody>
            </table>
          </div>
          <Link className="btn btn-warning" to={`/payment`}>
            Payment
          </Link>
        </div>
      </div>
    </div>
  );
};

export default Fullticket;
